import React from 'react';
import Course from './Course '
const CategoryCourses = (props) => {
  return (
    < >
      {
        props.category.map((e, i) => {
          return <div key={i}>
            <div className='course' onClick={() => { props.product(e.name) }, <Product />}>{e.name}</div>
          </div>
        })
      }
    </>
  );
};
export default CategoryCourses;
